import styled from "styled-components";
import Button from "react-bootstrap";

function StyledButton() {
  const StyledButton = styled(Button)`
    background-color: white;
    color: #89abe3;
    border-color: white;

    &:hover {
      background-color: #edcac4;
      border-color: #edcac4;
    }

    &:active {
      background-color: #edcac4;
    }
  `;

  return <StyledButton />;
}

export default StyledButton;
